INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (3,'This policy applies to all <xxx> employees, globally, for travel undertaken by employees away from their office location or normal place of work. Violators may be subject to disciplinary action, up to and including termination of employment.','This policy applies to all <xxx> employees, globally, for travel undertaken by employees away from their office location or normal place of work. Violators may be subject to disciplinary action, up to and including termination of employment.','This policy applies to all <xxx> employees, globally, for travel undertaken by employees away from their office location or normal place of work. Violators may be subject to disciplinary action, up to and including termination of employment.','This policy applies to all <xxx> employees, globally, for travel undertaken by employees away from their office location or normal place of work. Violators may be subject to disciplinary action, up to and including termination of employment.','This policy applies to all <xxx> employees, globally, for travel undertaken by employees away from their office location or normal place of work. Violators may be subject to disciplinary action, up to and including termination of employment.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (4,'When booking a trip with the Travel Agency or Online Booking Tool (OBT), you may be asked for your purpose of trip, and then the reason for you selecting the airline and hotels you have selected. Please answer as suitably as possible, as doing so helps improve the offerings that <xxx> can offer Team Members who travel.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you may be asked for your purpose of trip, and then the reason for you selecting the airline and hotels you have selected. Please answer as suitably as possible, as doing so helps improve the offerings that <xxx> can offer Team Members who travel.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you may be asked for your purpose of trip, and then the reason for you selecting the airline and hotels you have selected. Please answer as suitably as possible, as doing so helps improve the offerings that <xxx> can offer Team Members who travel.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you may be asked for your purpose of trip, and then the reason for you selecting the airline and hotels you have selected. Please answer as suitably as possible, as doing so helps improve the offerings that <xxx> can offer Team Members who travel.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you may be asked for your purpose of trip, and then the reason for you selecting the airline and hotels you have selected. Please answer as suitably as possible, as doing so helps improve the offerings that <xxx> can offer Team Members who travel.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (5,'To help reduce the environmental impact of our travel, we encourage team members to combine trips and do multiple meetings in a destination, or to travel from one destination directly to the next.','To help reduce the environmental impact of our travel, we encourage team members to combine trips and do multiple meetings in a destination, or to travel from one destination directly to the next.','To help reduce the environmental impact of our travel, we encourage team members to combine trips and do multiple meetings in a destination, or to travel from one destination directly to the next.','To help reduce the environmental impact of our travel, we encourage team members to combine trips and do multiple meetings in a destination, or to travel from one destination directly to the next.','To help reduce the environmental impact of our travel, we encourage team members to combine trips and do multiple meetings in a destination, or to travel from one destination directly to the next.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (6,'All travel bookings (airline, hotel, car rental etc) must be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is strictly prohibited, and will not be reimbursed for expenses.','All travel bookings (airline, hotel, car rental etc) must be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is strictly prohibited and may not be reimbursed for expenses.','All travel bookings (airline, hotel, car rental etc) should be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. The use of any provider, including booking direct with the provider (airline, hotel, car rental etc.) is prohibited and may not be reimbursed for expenses.','Travel bookings (airline, hotel, car rental etc) can be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here]. Fees associated with booking travel through these channels may be expensed. When booking travel outside of these channels, the TMC and/or leadership must be made aware for employee safety and security.','When booking travel (airline, hotel, car rental etc), employee leaders should be made aware of your travel itinerary for employee safety and security. Travel bookings can be made through the approved online booking tool (OBT) or the designated Employee Travel Office agency [TMC name to be provided by end user here] which will not require the employee to inform their leader of their detailed plans.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (7,'You must use the online booking tool (OBT) for point–to-point journeys or contact the travel agency for multi-stop complex journeys (e.g. A to B to C to A).','You should use the online booking tool (OBT) for point–to-point journeys or contact the travel agency for multi-stop complex journeys (e.g. A to B to C to A).','Where possible, use the online booking tool (OBT) for point–to-point journeys or contact the travel agency for multi-stop complex journeys (e.g. A to B to C to A).','Both an online booking tool (OBT) and a travel agency helpdesk for multi-stop complex journeys are available for travel bookings.','Both an online booking tool (OBT) for point–to-point journeys and a travel agency helpdesk phone are available for travel bookings.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (8,'When booking a trip with the Travel Agency or Online Booking Tool (OBT), you must book your air ticket, hotel stay, plus any relevant ground transport in a single trasaction.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you should book your air ticket, hotel stay, plus any relevant ground transport in a single trasaction.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), you should book your air ticket, hotel stay, plus any relevant ground transport in a single trasaction.','Where possible, when booking a trip with the Travel Agency or Online Booking Tool (OBT), you should book your air ticket, hotel stay, plus any relevant ground transport in a single trasaction.','When booking a trip with the Travel Agency or Online Booking Tool (OBT), ideally you should book your air ticket, hotel stay, plus any relevant ground transport in a single trasaction.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (9,'Should there be a need to rebook, Team Members must notify Global Travel as soon as possible to avoid fees that may occur closer to the time of travel.','Should there be a need to rebook, Team Members should notify Global Travel as soon as possible to avoid fees that may occur closer to the time of travel.','Should there be a need to rebook, we ask that Team Members notify Global Travel as soon as possible to avoid fees that may occur closer to the time of travel.','Should there be a need to rebook, team Members should look to do so as early as possible to avoid fees that may occur closer to the time of travel.','Should there be a need to rebook, where possible, team Members should look to do so as early as possible to avoid fees that may occur closer to the time of travel.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (10,'Team Members must notify the Global Travel Team as soon as possible if they need to cancel their travel. The unused air ticket will be applied to the Team Member’s next flight or otherwise used in the most cost-effective manner. If tickets have not been rebooked within 30 days of the ticket expiring, the credit will be used at the discretion of the company.   ','Team Members must notify the Global Travel Team as soon as possible if they need to cancel their travel. The unused air ticket will be applied to the Team Member’s next flight or otherwise used in the most cost-effective manner. If tickets have not been rebooked within 30 days of the ticket expiring, the credit will be used at the discretion of the company.   ','Team Members should notify the Global Travel Team as soon as possible if they need to cancel their travel. The unused air ticket will be applied to the Team Member’s next flight or otherwise used in the most cost-effective manner. If tickets have not been rebooked within 30 days of the ticket expiring, the credit will be used at the discretion of the company.   ','We ask Team Members notify the Global Travel Team as soon as possible if they need to cancel their travel. The unused air ticket will be applied to the Team Member’s next flight or otherwise used in the most cost-effective manner. If tickets have not been rebooked within 30 days of the ticket expiring, the credit will be used at the discretion of the company.   ','Please notify the Global Travel Team as soon as possible if you need to cancel their travel. The unused air ticket will be applied to the Team Member’s next flight or otherwise used in the most cost-effective manner. If tickets have not been rebooked within 30 days of the ticket expiring, the credit will be used at the discretion of the company.   ','Not applicable - do not include in policy.');
