INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (27,'Expenses incurred by spouses, partners or dependents of employees, for care due to corporate travel are notconsidered reimbursable.','Expenses incurred by spouses, partners or dependents of employees, for care due to notification of corporate travel within 12 hours are considered reimbursable.','Expenses incurred by spouses, partners or dependents of employees, for care due to notification of corporate travel within 24 hours are considered reimbursable.','Expenses incurred by spouses, partners or dependents of employees, for care due to notification of corporate travel within 48 hours are considered reimbursable.','Expenses incurred by spouses, partners or dependents of employees, for care or travel due to notification of corporate travel within 48 hours are considered reimbursable.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (28,'No commuting related travel can be expensed.','At supervisors discretion, where a team member works late on site, they may expense a private taxi home if public transport is not available.','At supervisors discretion, where a team member works late on site, they may expense a private taxi home if past midnight.','At supervisors discretion, where a team member works late on site, they may expense a private taxi home if past 10pm.','Where a team member works late on site, they may expense a private taxi home if past 10pm.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (29,'No commuting related travel can be expensed on public or company holidays','At supervisors discretion, where a team member works on a public or company holiday (outside of their normal work schedule), they may expense public transport cost to and from the point of work.','At supervisors discretion, where a team member works on a public or company holiday (outside of their normal work schedule) they may expense a form of travel to and from the point of work.','At supervisors discretion, where a team member works on a public or company holiday (outside of their normal work schedule) they may expense a taxi to and from the point of work.','Where a team member works on a public or company holiday (outside of their normal work schedule) they may expense a taxi to and from the point of work.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (30,'No commuting related travel can be expensed on weekends.','At supervisors discretion, where a team member works on a weekend (and outside of their normal work schedule), they may expense public transport cost to and from the point of work.','At supervisors discretion, where a team member works on a weekend (and outside of their normal work schedule) they may expense a form of travel to and from the point of work.','At supervisors discretion, where a team member works on a weekend (and outside of their normal work schedule) they may expense a taxi to and from the point of work.','Where a team member works late on site, they may expense a private taxi home if past 10pm.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (31,'Selection of provider (for air, hotel, car rental etc) based on frequent user programs is prohibited. In addition, employees must provide <xxx> any points earned through corporate travel to the company. Any membership fees associated with these programs in not reimbursable','Selection of provider (for air, hotel, car rental etc) based on frequent user programs is prohibited. In addition, employees may retain the benefits from the rewards programs for personal use, however any membership fees associated with these programs in not reimbursable','Selection of provider (for air, hotel, car rental etc) based on frequent user programs is prohibited. In addition, employees may retain the benefits from the rewards programs for personal use, however any membership fees associated with these programs in not reimbursable','Selection of provider (for air, hotel, car rental etc) based on frequent user programs is allowed where it falls within a reasonable price window. Employees may retain the benefits from the rewards programs for personal use. However, any reasonable membership fees associated with these programs in reimbursable','Selection of provider (for air, hotel, car rental etc) based on frequent user programs is allowed where it falls within a reasonable price window. Employees may retain the benefits from the rewards programs for personal use, and any reasonable membership fees associated with these programs in reimbursable','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (32,'All travel should be booked ideally four weeks in advance but certainly no less than 14 days in advance. Travel booked within 14 days should seek supervisor approval. By booking further in advance helps drives cost savings for <xxx>, with an average of 20% savings booking more than two weeks ahead.','All travel should be booked 14 days in advance or more. Travel booked within 14 days should seek supervisor approval. By booking further in advance helps drives cost savings for <xxx>, with an average of 20% savings booking more than two weeks ahead.','All travel should be booked 7 days in advance or more. Travel booked within 7 days should seek supervisor approval. By booking further in advance helps drives cost savings for <xxx>, with an average of 20% savings booking more than two weeks ahead.','Where possible and practical, we ask Team Members book travel as early as possible, to take advantage of lower. By booking further in advance helps drives cost savings for <xxx>, with an average of 20% savings booking more than two weeks ahead.','Where possible and practical, we ask Team Members book travel as early as possible, to take advantage of lower.','Not applicable - do not include in policy.');
