INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (34,'Baggage fees that are reasonable and appropriate for the purpose and length of the trip are reimbursable. Fees associated with baggage that is personal in nature. (e.g., golf clubs, skis) are not to be expensed. Check with the airline prior to departure for baggage size and weight restrictions. <xxx> does not cover the loss of personal items. If a Team Member’s luggage is lost, basic necessities will be reimbursed as an exception.','Baggage fees that are reasonable and appropriate for the purpose and length of the trip are reimbursable. Fees associated with baggage that is personal in nature. (e.g., golf clubs, skis) are not to be expensed. Check with the airline prior to departure for baggage size and weight restrictions. <xxx> does not cover the loss of personal items. If a Team Member’s luggage is lost, basic necessities will be reimbursed as an exception.','Baggage fees that are reasonable and appropriate for the purpose and length of the trip are reimbursable. Fees associated with baggage that is personal in nature. (e.g., golf clubs, skis) are not to be expensed. Check with the airline prior to departure for baggage size and weight restrictions. <xxx> does not cover the loss of personal items. If a Team Member’s luggage is lost, basic necessities will be reimbursed as an exception.','Baggage fees that are reasonable and appropriate for the purpose and length of the trip are reimbursable. Check with the airline prior to departure for baggage size and weight restrictions. <xxx> does not cover the loss of personal items. If a Team Member’s luggage is lost, basic necessities will be reimbursed as an exception.','Baggage fees that are reasonable and appropriate for the purpose and length of the trip are reimbursable. Check with the airline prior to departure for baggage size and weight restrictions. <xxx> does not cover the loss of personal items. If a Team Memb