INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (37,'Payments for seat selection and/or early boarding is not reimbursable.','Payments for seat selection of “premium seating” (i.e., seating with extra legroom) are not reimbursable. Early boarding fees are reimbursable.','At supervisors discretion, payments for seat selection of “premium seating” (i.e., seating with extra legroom) are not reimbursable if under $20. Early boarding fees are reimbursable. Employees cannot be reimbursed for both early boarding and seat upgrades on the same flight.','At supervisors discretion, payments for seat selection of “premium seating” (i.e., seating with extra legroom) are not reimbursable.','Payments for seat selection (within cabin policy) are expensable. In addition, early boarding can be expensed.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (38,'Team Members who are pre-certified by HR may fly in seats with more legroom or a higher cabin based on a physician approved health condition or disability. For example, a recent surgery prohibits use of coach class service. Requests for such certification must be approved by HR and submitted to Global Travel before a flight can be booked.','Team Members who are pre-certified by HR may fly in seats with more legroom or a higher cabin based on a physician approved health condition or disability. For example, a recent surgery prohibits use of coach class service. Requests for such certification must be approved by HR and submitted to Global Travel before a flight can be booked.','Team Members who are pre-certified by HR may fly in seats with more legroom or a higher cabin based on a physician approved health condition or disability. For example, a recent surgery prohibits use of coach class service. Requests for such certification must be approved by HR and submitted to Global Travel before a flight can be booked.','Team Members who are pre-certified by HR may fly in seats with more legroom or a higher cabin based on a physician approved health condition or disability. For example, a recent surgery prohibits use of coach class service. Requests for such certification must be approved by HR and submitted to Global Travel before a flight can be booked.','Team Members who are pre-certified by HR may fly in seats with more legroom or a higher cabin based on a physician approved health condition or disability. For example, a recent surgery prohibits use of coach class service. Requests for such certification must be approved by HR and submitted to Global Travel before a flight can be booked.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (39,'No exceptions exist for red eye flights.','At supervisors discretion,  red eye flight can be booked business class, though you should also consider whether it is possible to travel at a different time to reduce costs of travel.','At supervisors discretion, red eye flights can be booked business class.','Redeye flights can be booked business class, though you should also consider whether it is possible to travel at a different time to reduce costs of travel.','Redeye can be booked business class.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (40,'No exceptions exist for overnight flights where the traveler goes straight into the office.','At supervisors discretion, where travel is overnight and where you are starting work immediately after the journey, can be booked business class, though you should also consider whether it is possible to travel at a different time to reduce costs of travel.','At supervisors discretion, where travel is overnight and where you are starting work immediately after the journey, can be booked business class.','Midhaul flights (5 hours +), where travel is overnight and where you are starting work immediately after the journey, should be booked business class, though you should also consider whether it is possible to travel at a different time to reduce costs of travel.','Overnight flights where you are starting work immediately after the journey can be booked business class.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (41,'Flights with single engine piston aircraft should not be booked without clearance from <xxx> Security. In addition, aircraft of any type cannot be piloted for the purposes of corporate travel.','Flights with single engine piston aircraft should not be booked without clearance from <xxx> Security. In addition, aircraft of any type cannot be piloted for the purposes of corporate travel.','Flights with single engine piston aircraft should not be booked without clearance from <xxx> Security. In addition, aircraft of any type cannot be piloted for the purposes of corporate travel.','Flights with single engine piston aircraft should not be booked without clearance from <xxx> Security. In addition, aircraft of any type cannot be piloted for the purposes of corporate travel.','Flights with single engine piston aircraft should not be booked without clearance from <xxx> Security. In addition, aircraft of any type cannot be piloted for the purposes of corporate travel.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (42,'Where possible and practical, no more than 10% of a team can be on a single flight for safety precautions.','Where possible and practical, no more than 25% of a team can be on a single flight for safety precautions.','Where possible and practical, no more than 33% of a team can be on a single flight for safety precautions.','Where possible and practical, no more than 50% of a team can be on a single flight for safety precautions.','Where possible and practical, do not have all team members of the same fight for safety precautions.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (43,'The Company’s authorized Travel Agency and Online Booking Tool (OBT) will provide the Lowest Logical Fare (LLF) to the Team Member.  The LLF is the lowest available fare given a number of variables including the number of days in advance of the travel date that the ticket is booked; a time window in which flight options are evaluated; direct flight vs. indirect; and company preferred airlines. Booking an option that is not considered within an acceptable cost window will not be expensed.','The Company’s authorized Travel Agency and Online Booking Tool (OBT) will provide the Lowest Logical Fare (LLF) to the Team Member.  The LLF is the lowest available fare given a number of variables including the number of days in advance of the travel date that the ticket is booked; a time window in which flight options are evaluated; direct flight vs. indirect; and company preferred airlines. Booking an option that is not considered within an acceptable cost window may be asked for the reason, and may not be expensed.','The Company’s authorized Travel Agency and Online Booking Tool (OBT) will provide the Lowest Logical Fare (LLF) to the Team Member.  The LLF is the lowest available fare given a number of variables including the number of days in advance of the travel date that the ticket is booked; a time window in which flight options are evaluated; direct flight vs. indirect; and company preferred airlines. Booking an option that is not considered within an acceptable cost window may be asked for the reason.','<xxx> requests that Team Members look to ensure that they are booking the best flight based on total cost (airfare plus extras such as luggage) and total trip time.','<xxx> asks that Team Members look to ensure that they are booking the best flight based on total cost (airfare plus extras such as luggage) and total trip time.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (44,'Team Members must accept flights with connections when the cost is lower and their travel schedules allow.','Team Members should accept flights with connections when the cost is lower and their travel schedules allow.','Team Members should consider accepting flights with connections when the cost is lower where their travel schedules allow.','Team Members should only consider accepting flights with connections when the cost is $300 lower or greater, and where their travel schedules allow.','Team Members should only consider accepting flights with connections when the cost is $600 lower or greater, and where their travel schedules allow.','Not applicable - do not include in policy.');
INSERT INTO answer (question_id,answer_1, answer_2, answer_3, answer_4, answer_5,answer_6 ) VALUES  (45,'On some routes, <xxx> looks to ensure that trips do not exceed a set amount. The Travel Agency and Online Booking Tool will notify you when the threshold has been exceeded. In that situation, please book your trip for different dates.','On some routes, <xxx> looks to ensure that trips do not exceed a set amount. The Travel Agency and Online Booking Tool will notify you when the threshold has been exceeded. In that situation, please book your trip for different dates, or seek supervisor approval if travel is required for that time.','On some routes, <xxx> looks to ensure that trips do not exceed a set amount. The Travel Agency and Online Booking Tool will notify you when the threshold has been exceeded. In that situation, where possibke please book your trip for different dates, or seek supervisor approval to book above the route cap threshold if travel is required for that time.','On some routes, <xxx> looks to ensure that trips do not exceed a set amount. The Travel Agency and Online Booking Tool will notify you when the threshold has been exceeded. In that situation, where possibke please book your trip for different dates, or seek supervisor approval to book above the route cap threshold if travel is required for that time.','On some routes, <xxx> looks to ensure that trips do not exceed a set amount. The Travel Agency and Online Booking Tool will notify you when the threshold has been exceeded. In that situation, where possibke please book your trip for different dates, or seek supervisor approval to book above the route cap threshold if travel is required for that time.','Not applicable - do not include in policy.');
